import React from "react";
import { B, Routes, Route } from "react-router-dom";

import Home from "../pages/Home";
import Login from "../pages/Login";

const index = () => {
  return (
    <Router>
      <Routes>
          <Route path="/" element={<Login />}/>
      </Routes>
    </Router>
  );
};

export default index;
